import React, { Component } from "react";
import "./App.css";
import Header from "./components/Header";
import RentalList from "./components/Rental/RentalList";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <br />
        <div className="container">
          <RentalList />
        </div>
      </div>
    );
  }
}

export default App;
